window.bookSummaryJSON = "<p><b>The start of a swashbuckling adventure from </b><b><i>New York Times</i></b><b> best-selling author Margaret Weis and Robert Krammes</b></p> <p>Captain Kate Fitzmaurice was born to sail. She has made a life of her own as a privateer and smuggler. Hired by the notorious Henry Wallace, spymaster for the queen of Freya, to find a young man who claims to be the true heir to the Freyan, she begins to believe that her ship has finally come in.</p> <p>But no fair wind lasts forever. Soon Kate's checkered past will catch up to her. It will take more than just quick wits and her considerable luck if she hopes to bring herself - and her crew - through intact.</p>"; 
